import React, { Component } from "react";
import { Link } from "react-router-dom";
import parse from "html-react-parser";

import moment from "moment";
import { useDispatch } from "react-redux";
const Plan = () => {
  let publicUrl = process.env.PUBLIC_URL + "/";
  let imagealt = "image";

  const dispatch = useDispatch();

  const user = JSON.parse(localStorage.getItem("profile"));

  return (
    <>
      <div className="col-lg-4 col-md-6">
        <div className="single-destination-grid text-center">
          <div className="thumb">
            <img
              src={publicUrl + "assets/img/destination-list/8.png"}
              alt="img"
            />
          </div>
          <div className="details">
            <div className="tp-review-meta">
              <i className="ic-yellow fa fa-star" />
              <i className="ic-yellow fa fa-star" />
              <i className="ic-yellow fa fa-star" />
              <i className="ic-yellow fa fa-star" />
              <i className="fa fa-star" />
              <span>4.0</span>
            </div>
            <h3 className="title">Sài Gòn</h3>
            <p className="content">
              SG is the world's second largest and second most- populous
              continent, being behind Asia in both. At about 30.3 million km²
              including adjacent islands, it 6% Earth's total surface area and
              20% land area.
            </p>
            <Link className="btn btn-gray" to="/destination-details">
              <span>
                Explore
                <i className="la la-arrow-right" />
              </span>
            </Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default Plan;
